import React from 'react'
import '../../Style/PostAdd.css'

function PostAdd({setCompanyName,setCode,setWeight,setProductName,setGenesisAddress,test}) {
    function handleChangeCompany(event) {
        setCompanyName(event.target.value);
    }
    function handleChangeCode(event) {
        setCode(event.target.value);
    }
    function handleChangeProduct(event) {
        setProductName(event.target.value);
    }
    function handleChangeGenesis(event) {
        setGenesisAddress(event.target.value);
    }
    function handleChangeWeight(event) {
        setWeight(event.target.value);
    }
    function handleClick(){
        test()
    }
    return (
        <div className='postbody-box-right-back'>
            <div className='postbody-box-right-title'>
                Add Infomation
            </div>
            <div className='postbody-box-right-content'>
                <div>
                    <input className='postbody-input' placeholder="ProductName" onChange={handleChangeProduct}/>
                </div>
                <div>
                    <input className='postbody-input' placeholder="Code" onChange={handleChangeCode}/>
                </div>
                <div>
                    <input className='postbody-input' placeholder="Weight" onChange={handleChangeWeight}/>
                </div>
                <button className='p' onClick={handleClick}>Send</button>
            </div>
        </div>
    )
}

export default PostAdd
